import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
// import App from './App';
import $ from 'jquery';
import InputCpu from './components/InputCpu';
import InputMotherboard from './components/InputMotherboard';
import InputGPU from './components/InputGPU';
import InputStorage from './components/InputStorage';
import InputCasing from './components/InputCasing';


$('#ambilCPU').on('click', function (event) {
  ReactDOM.render(
    <React.StrictMode>
      <div className='container'>
        <InputCpu />
      </div>
    </React.StrictMode>,
    document.getElementById('root')
  );
});

$('#ambilMotherboard').on('click', function (event) {
  ReactDOM.render(
    <React.StrictMode>
      <div className='container'>
        <InputMotherboard />
      </div>
    </React.StrictMode>,
    document.getElementById('root')
  );
});

$('#ambilVGA').on('click', function (event) {
  ReactDOM.render(
    <React.StrictMode>
      <div className='container'>
        <InputGPU />
      </div>
    </React.StrictMode>,
    document.getElementById('root')
  );
});

$('#ambilSSD').on('click', function (event) {
  ReactDOM.render(
    <React.StrictMode>
      <div className='container'>
        <InputStorage />
      </div>
    </React.StrictMode>,
    document.getElementById('root')
  );
});

$('#ambilFan').on('click', function (event) {
  ReactDOM.render(
    <React.StrictMode>
      <div className='container'>
        <InputGPU />
      </div>
    </React.StrictMode>,
    document.getElementById('root')
  );
});

$('#ambilCase').on('click', function (event) {
  ReactDOM.render(
    <React.StrictMode>
      <div className='container'>
        <InputCasing />
      </div>
    </React.StrictMode>,
    document.getElementById('root')
  );
});

$.ajax({
  url: '../login.html/login',
  type: "POST",
  data: 'your form data',
  false: function (response) {
    alert('evaluate response and show alert');
  }
});
